// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "./StrategyProxy.sol";

/**
 * @title FactoryContract
 * @dev Deploys individual StrategyProxy contracts for users based on selected strategies.
 * Manages the addresses of the underlying strategy implementation contracts.
 */
contract FactoryContract {
    address public admin;
    address public hyperliquidRouter;
    uint8 public defaultLeverage;
    uint256 public platformFeeBps;
    
    mapping(string => address) private implementations;
    event ProxyDeployed(address indexed user, address proxyAddress, string strategyName);
    event ImplementationSet(string strategyName, address implementation);

    modifier onlyAdmin() {
        require(msg.sender == admin, "FactoryContract: caller is not admin");
        _;
    }

    constructor(
        address _admin,
        address _hyperliquidRouter,
        uint8 _defaultLeverage,
        uint256 _platformFeeBps
    ) {
        require(_admin != address(0), "FactoryContract: admin cannot be zero address");
        require(_hyperliquidRouter != address(0), "FactoryContract: router cannot be zero address");
        
        admin = _admin;
        hyperliquidRouter = _hyperliquidRouter;
        defaultLeverage = _defaultLeverage;
        platformFeeBps = _platformFeeBps;
    }

    function setStrategyImplementation(string memory strategyName, address implementation) external onlyAdmin {
        require(implementation != address(0), "FactoryContract: implementation cannot be zero address");
        implementations[strategyName] = implementation;
        emit ImplementationSet(strategyName, implementation);
    }

    function getImplementation(string memory strategyName) external view returns (address) {
        return implementations[strategyName];
    }

    function deployProxy(string memory strategyName) external returns (address) {
        address implementation = implementations[strategyName];
        require(implementation != address(0), "FactoryContract: strategy not found");

        StrategyProxy proxy = new StrategyProxy(
            msg.sender,           // _owner
            implementation,       // _implementation
            admin,                // _feeRecipient
            hyperliquidRouter,    // _hypeliquidRouter
            admin,                // _admin
            defaultLeverage,      // _leverage
            platformFeeBps        // _platformFeeBps
        );
        
        emit ProxyDeployed(msg.sender, address(proxy), strategyName);
        
        return address(proxy);
    }
    
    // Utility functions to update parameters
    function updateHyperliquidRouter(address _newRouter) external onlyAdmin {
        require(_newRouter != address(0), "FactoryContract: new router cannot be zero address");
        hyperliquidRouter = _newRouter;
    }
    
    function updateDefaultLeverage(uint8 _newLeverage) external onlyAdmin {
        defaultLeverage = _newLeverage;
    }
    
    function updatePlatformFeeBps(uint256 _newPlatformFeeBps) external onlyAdmin {
        platformFeeBps = _newPlatformFeeBps;
    }
}

