// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "./interface/IStrategy.sol";

/**
 * @title StrategyProxy
 * @dev This contract acts as a user's individual interface for a specific strategy instance.
 * It holds the user's collateral, delegates strategy logic calls to an implementation contract,
 * and manages deposits/withdrawals.
 */
contract StrategyProxy {
    address public hypeliquidRouter; // slot 0
    address public admin;            // slot 1
    uint8 public leverage;           // slot 2
    uint256 public platformFeeBps;   // slot 3
    address public proxyOwner;       // slot 4

    address public owner;
    address public implementation;
    address public feeRecipient; // Address to send platform fees

    event OwnershipTransferred(address indexed previousOwner, address indexed newOwner);

    // Using a simple balance mapping for collateral (e.g., USDC)
    // In a real scenario, this would interact with an ERC20 token contract
    uint256 public userBalance; // Represents the user's collateral balance held by this proxy

    event Deposited(address indexed user, uint256 amount);
    event Withdrawn(address indexed user, uint256 amount);
    event LiquidityAdded(address indexed user, uint256 amount);
    event LiquidityRemoved(address indexed user, uint256 amount);
    event Executed(address indexed user);

    modifier onlyOwner() {
        require(msg.sender == owner, "StrategyProxy: caller is not the owner");
        _;
    }

    /**
     * @dev Sets the immutable owner, implementation contract, and fee recipient.
     * @param _owner The user who owns this proxy instance.
     * @param _implementation The address of the strategy logic implementation contract.
     * @param _feeRecipient The address where platform fees should be sent.
     */
    constructor(
        address _owner, 
        address _implementation, 
        address _feeRecipient,
        address _hypeliquidRouter,
        address _admin,
        uint8 _leverage,
        uint256 _platformFeeBps
    ) {
        require(_owner != address(0), "StrategyProxy: Owner cannot be zero address");
        require(_implementation != address(0), "StrategyProxy: Implementation cannot be zero address");
        require(_feeRecipient != address(0), "StrategyProxy: Fee recipient cannot be zero address");
        require(_hypeliquidRouter != address(0), "StrategyProxy: Router cannot be zero address");

        owner = _owner;
        implementation = _implementation;
        feeRecipient = _feeRecipient;
        hypeliquidRouter = _hypeliquidRouter;
        admin = _admin;
        leverage = _leverage;
        platformFeeBps = _platformFeeBps;
        emit OwnershipTransferred(address(0), _owner);
    }

    function transferOwnership(address newOwner) external onlyOwner {
        require(newOwner != address(0), "StrategyProxy: new owner is the zero address");
        emit OwnershipTransferred(owner, newOwner);
        owner = newOwner;
    }

    /**
     * @dev Allows the owner to deposit collateral (e.g., USDC).
     * In a real implementation, this would involve transferring ERC20 tokens *to* this contract.
     * For simplicity here, we just update the balance. The actual token transfer
     * needs to happen externally before calling this or be integrated using IERC20.
     * @param amount The amount of collateral to deposit.
     */
    function deposit(uint256 amount) external payable {
        require(msg.sender == owner, "StrategyProxy: Only owner can deposit");
        // TODO: Implement actual ERC20 token transfer logic (e.g., IERC20(tokenAddress).transferFrom(msg.sender, address(this), amount))
        userBalance += amount;
        emit Deposited(owner, amount);
    }

    /**
     * @dev Allows the owner to withdraw collateral.
     * In a real implementation, this would involve transferring ERC20 tokens *from* this contract.
     * @param amount The amount of collateral to withdraw.
     */
    function withdraw(uint256 amount) external {
        require(msg.sender == owner, "StrategyProxy: Only owner can withdraw");
        require(userBalance >= amount, "StrategyProxy: Insufficient balance");
        userBalance -= amount;
        // TODO: Implement actual ERC20 token transfer logic (e.g., IERC20(tokenAddress).transfer(owner, amount))
        emit Withdrawn(owner, amount);
    }

    /**
     * @dev Delegates the call to the implementation contract's addLiquidity function.
     * Passes the fee recipient address to the implementation.
     * @param amount The amount related to adding liquidity (e.g., collateral amount).
     */
    function addLiquidity(uint256 amount) external {
        require(msg.sender == owner, "StrategyProxy: Only owner can add liquidity");
        // Delegate call to implementation
        (bool success, bytes memory result) = implementation.delegatecall(
            abi.encodeWithSelector(IStrategy.addLiquidity.selector, amount, feeRecipient)
        );
        if(!success){
            if(result.length > 0){
                assembly {
                    let resultSize := mload(result)
                    let resultData := add(result, 32) // Skip the first 32 bytes (length of the data)
                    revert(resultData, resultSize) // Revert with the error message from the implementation
                }
            }
            revert("StrategyProxy: addLiquidity delegation failed");
        }
        emit LiquidityAdded(owner, amount);
        // Handle potential return data if needed: abi.decode(result, (types...))
    }

    /**
     * @dev Delegates the call to the implementation contract's removeLiquidity function.
     * Passes the fee recipient address to the implementation.
     * @param amount The amount related to removing liquidity.
     */
    function removeLiquidity(uint256 amount) external {
        require(msg.sender == owner, "StrategyProxy: Only owner can remove liquidity");
        // Delegate call to implementation
        (bool success, bytes memory result) = implementation.delegatecall(
            abi.encodeWithSelector(IStrategy.removeLiquidity.selector, amount, feeRecipient)
        );
        require(success, "StrategyProxy: removeLiquidity delegation failed");
        emit LiquidityRemoved(owner, amount);
        // Handle potential return data if needed
    }

    /**
     * @dev Delegates the call to the implementation contract's execute function.
     * This function typically handles rebalancing or other periodic strategy actions.
     */
    function execute() external {
        // Potentially restrict who can call execute (e.g., owner, or a designated keeper)
        // require(msg.sender == owner, "StrategyProxy: Only owner can execute"); // Or allow others?
        (bool success, bytes memory result) = implementation.delegatecall(
            abi.encodeWithSelector(IStrategy.execute.selector)
        );
        require(success, "StrategyProxy: execute delegation failed");
        emit Executed(owner);
        // Handle potential return data if needed
    }

    // --- View Functions (Delegated) ---

    function getProfitLoss() external view returns (int256 pnl) {
        (bool success, bytes memory result) = implementation.staticcall(
            abi.encodeWithSelector(IStrategy.getProfitLoss.selector)
        );
        require(success, "StrategyProxy: getProfitLoss staticcall failed");
        pnl = abi.decode(result, (int256));
    }

    // Note: Assumes Trade struct is defined in the imported IStrategy.sol file
    function getTradeHistory() external view returns (Trade[] memory history) {
        (bool success, bytes memory result) = implementation.staticcall(
            abi.encodeWithSelector(IStrategy.getTradeHistory.selector)
        );
        require(success, "StrategyProxy: getTradeHistory staticcall failed");
        history = abi.decode(result, (Trade[])); // Use Trade[] directly
    }

    function getBalance() external view returns (uint256 balance) {
        // Returns the collateral balance held directly by the proxy
        // Or could delegate to implementation's getBalance if that's the source of truth
         (bool success, bytes memory result) = implementation.staticcall(
             abi.encodeWithSelector(IStrategy.getBalance.selector)
         );
         require(success, "StrategyProxy: getBalance staticcall failed");
         return abi.decode(result, (uint256));
        // return userBalance; // Keep this if proxy balance is separate source of truth
    }

    // Note: Assumes Holding struct is defined in the imported IStrategy.sol file
    function getHoldings() external view returns (Holding[] memory holdings) {
        (bool success, bytes memory result) = implementation.staticcall(
            abi.encodeWithSelector(IStrategy.getHoldings.selector)
        );
        require(success, "StrategyProxy: getHoldings staticcall failed");
        holdings = abi.decode(result, (Holding[])); // Use Holding[] directly
    }

     /**
     * @dev Delegates the call to the implementation contract's getOwner function.
     */
    function getOwner() external view returns (address ownerAddress) {
        (bool success, bytes memory result) = implementation.staticcall(
            abi.encodeWithSelector(IStrategy.getOwner.selector)
        );
        require(success, "StrategyProxy: getOwner staticcall failed");
        ownerAddress = abi.decode(result, (address));
    }


    // --- Fallback and Receive ---

    /**
     * @dev Fallback function to handle plain Ether transfers and delegate other calls.
     * Be cautious with delegatecall in fallback, ensure implementation is trusted.
     */
    fallback() external payable {
        _delegate(implementation);
    }

    /**
     * @dev Receive function to handle plain Ether transfers.
     */
    receive() external payable {
        _delegate(implementation);
    }

    function _delegate(address _impl) internal {
        assembly {
            // Copy msg.data. We take full control of memory in this inline assembly
            // block because it will not return to Solidity code. We overwrite the
            // Solidity scratch pad at memory position 0.
            calldatacopy(0, 0, calldatasize())

            // Call the implementation.
            // out and outsize are 0 because we don't know the size yet.
            let result := delegatecall(gas(), _impl, 0, calldatasize(), 0, 0)

            // Copy the returned data.
            returndatacopy(0, 0, returndatasize())

            switch result
            // delegatecall returns 0 on error.
            case 0 {
                revert(0, returndatasize())
            }
            default {
                return(0, returndatasize())
            }
        }
    }
}

